import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Leaderboard() {
  const [mostWins, setMostWins] = useState([]);
  const [bestWinPercentage, setBestWinPercentage] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const response = await axios.get('http://localhost:3001/leaderboard');
      setMostWins(response.data.mostWins);
      setBestWinPercentage(response.data.bestWinPercentage);
    }
    fetchData();
  }, []);

  return (
    <div>
      <h2>Leaderboard - Most Wins</h2>
      <table>
        <thead>
          <tr>
            <th>User</th>
            <th>Wins</th>
          </tr>
        </thead>
        <tbody>
          {mostWins.map((user, index) => (
            <tr key={user.userId}>
              <td>{user.userId}</td>
              <td>{user.wins}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h2>Leaderboard - Best Win Percentage</h2>
      <table>
        <thead>
          <tr>
            <th>User</th>
            <th>Win Percentage</th>
          </tr>
        </thead>
        <tbody>
          {bestWinPercentage.map((user, index) => (
            <tr key={user.userId}>
              <td>{user.userId}</td>
              <td>{((user.wins / (user.wins + user.losses)) * 100).toFixed(2)}%</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Leaderboard;
